PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
	id VARCHAR NOT NULL, 
	name VARCHAR(120) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE IF NOT EXISTS "measurements" (
	id VARCHAR NOT NULL, 
	user_id VARCHAR NOT NULL, 
	creation_date DATETIME, 
	weight_kg FLOAT, 
	heart_rate INTEGER, 
	peak_count INTEGER, 
	body_fat_percent FLOAT, 
	backend_sway_area_mm2 INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES users (id)
);
COMMIT;
